import React from 'react'

const Header = (props) => {
  return (
    <>
      <h1>
        {props.course}
      </h1>
    </>
  )
}

const Part = (props)=> {
  return (
    <>
    <p>{props.part} {props.exercises}</p>
    </>
  )
}

const Content = (props) => {
  return (
    <>
    <Part part={props.parts[0].name} exercises={props.parts[0].exercisess}/>
    <Part part={props.parts[1].name} exercises={props.parts[1].exercisess}/>
    <Part part={props.parts[2].name} exercises={props.parts[2].exercisess}/>
    </>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
        Number of exercises {props.exercises1 + props.exercises2 + props.exercises3}
      </p>

    </div>
  )
}

const App = () => {
  const course = {
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10
      },
      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]
  }

  return (
    <div>
      <Header course={course.name}/>
      <Content parts={parts} />
      <Total parts={parts} />
    </div>
  )
}

export default App
